import { useNavigate, useParams } from "react-router-dom";

interface SignUpFormData {
  title: string;
  description: string;
  formTag1: string;
  formTag2: string;
  formTag3: string;
}

export const Form = (formData: SignUpFormData) => {
  const navigate = useNavigate();
  const parameters: string | undefined = useParams().user;

  console.log(formData);
  return (
    <>
      <p
        className="redirect-sign-up"
        onClick={() =>
          navigate(`/signup/${parameters === "mentor" ? "business" : "mentor"}`)
        }
      >
        Wanna go home?
      </p>

      <p className="sign-up-title">{formData.title} Sign Up</p>
      <p className="sign-up-description">{formData.description}</p>
      <input className="form-input" placeholder={formData.formTag1}></input>
      <input className="form-input" placeholder={formData.formTag2}></input>
      <input className="form-input" placeholder={formData.formTag3}></input>
    </>
  );
};
